import './App.css';
import { Container, Navbar, Dropdown, Button, Nav, Modal } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';

const [show, setShow] = useState(false);

const handleClose = () => setShow(false);
const handleShow = () => setShow(true);

function App() {
  return (
    <>
      <style type="text/css">
      {`
        .game-title {
          color: orange;
          font-weight: 800;
          font-size: 40px;
        }

        .medicine-app {
          font-size: 20px;
          margin-bottom: -15px;
        }

        .content {
          margin-top: 20px;
          margin-bottom: 20px;
        }

        .button-style {
          background-color: white;
          border: 1px solid rgba(0, 0, 0, 0.55);
          color: rgba(0, 0, 0, 0.55);
        }

        .button-style:hover {
          background-color: orange;
          border: 1px solid orange;
        }

        #create-user {
          margin-left: 15px;
        }

      `}
    </style>
    <Navbar bg="light" variant="light">
      <Container>
        <Navbar.Brand href="#home" className="game-title">Duranki</Navbar.Brand>
        <Navbar.Text className="medicine-app">- Medizinapp</Navbar.Text>
        <Navbar.Toggle />
        <Navbar.Collapse className="justify-content-end">
          <Navbar.Text>
            Made by HOLA - Vr Trail Walking Group
          </Navbar.Text>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    <Container className="content">
      <Nav className="me-auto">
        <Dropdown>
          <Dropdown.Toggle variant="success" className="button-style">
            Select User
          </Dropdown.Toggle>
          <Dropdown.Menu>
            <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
            <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
            <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
          </Dropdown.Menu>
        </Dropdown>
        <Button variant="success" className="button-style" id="create-user">Create new User</Button>
        <Modal show={show} onHide={handleClose}>
          <Modal.Header closeButton>
            <Modal.Title>Modal heading</Modal.Title>
          </Modal.Header>
          <Modal.Body>Woohoo, you're reading this text in a modal!</Modal.Body>
          <Modal.Footer>
            <Button variant="secondary" onClick={handleClose}>
              Close
            </Button>
            <Button variant="primary" onClick={handleClose}>
              Save Changes
            </Button>
          </Modal.Footer>
        </Modal>
      </Nav>
    </Container>
  </>
  );
}

export default App;
